import React from 'react';
class DisplayList extends React.Component{
    render(){
        return (
            <>
            {this.props.list.map(item => 
            <li>{item.name}, {item.attribute}, {item.advantage}, <Image src={item.image} thumbnail /></li>)}          
            </>
        );
    }
}
export default DisplayList;
